import axios from 'axios'

export const api = axios.create({
    baseURL: "http://51.222.48.12/mezapBack/auth"
});

export const createSession = async (cliente, login, password) => {
    return api.get('/index.php?cliente=${cliente}&login=${login}&password=${password}')
}
